import { View, Text, TextInput,StyleSheet } from 'react-native'
import React from 'react'

const Custominput = () => {
  return (
    <View>
      <TextInput/>
    </View>
  )
}
const styles = StyleSheet.create({
    container:{},
    input:{}
})
export default Custominput
